import React from "react";
import styled from "styled-components";

const ASideBottomPresenter = styled.div`
  background-color: #1d41f0;
  width: 240px;
  height: 100vh;
  margin-left: 56px;
  border-top: 1.4px solid #1e7efa;
`;

export default ASideBottomPresenter;
